script: |
  super -f text -I q8312.spq | sort > q8312.out

inputs:
  - name: q8312.spq
    data: |
      SELECT - ( 57 ) / cor0.col0 + + 76 FROM tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0;
  - name: tab0
  - name: tab1

outputs:
  - name: q8312.out
    data: |
      57
      57
      57
      76
      76
      76
      76
      76
      76
